using namespace std;

typedef ap_axiu<32,1,1,1> stream_type;

void hailstone(stream_type* in_data, stream_type* out_data, ap_int<32> buf_len){
#pragma HLS INTERFACE ap_ctrl_none register port=return
#pragma HLS INTERFACE s_axilite register port=&buf_len
#pragma HLS INTERFACE axis port=&in_data
#pragma HLS INTERFACE axis port=&out_data
 int cur, count;
  stream_type cur_data;
  int i;

  for(i = 0; i < buf_len; ++i){
    cur_data = in_data[i];

    cur = cur_data.data.to_long();
    count = 0;

    out_data[i].dest = cur_data.dest;
    out_data[i].id = cur_data.id;
    out_data[i].keep = cur_data.keep;
    out_data[i].last = cur_data.last;
    out_data[i].strb = cur_data.strb;
    out_data[i].user = cur_data.user;

    while(1) {
      if (cur % 2) {
 if (cur <= 1){
   out_data[i].data = count;
   break;
 } else {
   cur = ((cur * 3) +1)/2;
   count += 2;
 }
      } else {
 cur /= 2;
 count++;
      }
    }
  }
}


int main(int argc, char** argv){
  ofstream fp;
  int i, s, e, buf_len, ret;
  stream_type *hc_in, *hc_out;

  s = 1;
  e = 16;
  buf_len = e-s;

  hc_in = (stream_type*) malloc(sizeof(stream_type) * buf_len);
  for(i = 0; i < buf_len ; ++i) {
    hc_in[i].data = s+i;
  }

  hc_out = (stream_type*) malloc(sizeof(stream_type) * buf_len);

  hailstone(hc_in, hc_out, buf_len);

  fp.open("hresult.dat");
  for(i = 0; i < buf_len ; ++i) {
    int h = hc_out[i].data.to_int();
    cout << h << endl;
    fp << h << endl;
  }
  fp.close();

  free(hc_in);
  free(hc_out);

  ret = system("diff --brief -w hresult.dat hresult.golden.dat");
  if(ret != 0) {
    cout << "Test failed !!!\n";
    ret = 1;
  } else cout << "Test passed !\n";


  return ret;
}
